    const styles = StyleSheet.create({
        container: {
          flex: 1,
          justifyContent: 'space-between',
          backgroundColor: '#ecf0f1',
          padding: 8,
          flexDirection:'row',
          alignItems:'center'
        }
    });    
    return (

            <div class="card" style={{height: 300, alignItems: "center"}}>
                {/* <div class="card-image">
